var React = require("react")
var d3 = require("d3")

var TableBar = (props) => {
    return (
      <table className ="table">
        <tbody>
          {
            props.rows !== undefined ? props.rows.map((row, i) =>
              <tr key = {"row"+i}>
                  <td key = {row.key}>{row.map(d => d.endorsee)} </td>
                  <td key = {i}>
                    <svg width = {71} height = {12}>
                    <g style={{ fill: props.colors(i) }}>
                    <rect
                    width = {row[1] - row[0]}
                    height = { 12 }
                    style = {{
                      fill: "lightblue"
                    }}

                    />
                    </g>
                    </svg>

                   </td>
              </tr>
              ) : null
          }
        </tbody>

      </table>
      )
   }

export default TableBar
